const Contact = () => {
  return (
    <section>
      <div>
        <h1> Reach Me At</h1>
        <ul>
          <li>E-Mail: moemenmadouh@gmail.com</li>
          <li>Phone/Whatsapp: 01009691710</li>
          <li>
            Github:
            <a href=' https://github.com/mo96-dv'> </a>
          </li>
        </ul>
      </div>
      <label>Sent Me A Message Here</label>
      <textarea></textarea>
    </section>
  );
};

export default Contact;
